Iterate over a mongoDB collection, perform an asynchronous task of Aggregation for each item, and when they’re all done return JSON in Response<p>Trying to aggregate some data from a list of MongoDB collection and when aggregation is done over all the collections, I want to return the complete aggregation of all the suitable collections with the name and aggregated value as a JSON object back.
New to node.js programming, hence not able to solve this trivial problem. any help appreciated</p>

<p>Code:</p>

<pre><code>app.get('/tester', (req, res) =&gt; {

    var AggArr = [];

    db.listCollections().toArray(function (err, collInfos) {
        async.forEachOf(collInfos, (value, key, callback) =&gt; {
            aggregate(value);
        }, err =&gt; {
            if (err)
                console.error(err.message);
            // configs is now a map of JSON data
            res.send(JSON.stringify(AggArr));
        });
    });
        function aggregate(collname) {
        if (collname.name.includes("_tps")) {
            db.collection(collname.name).aggregate([{
                        $match: {
                            $and: [{
                                    TIME: {
                                        $gte: new Date("2017-01-01T00:00:00Z")
                                    }
                                }, {
                                    TIME: {
                                        $lte: new Date("2017-12-31T23:59:59Z")
                                    }
                                }
                            ]
                        }
                    }, {
                        $group: {
                            _id: collname.name,
                            sum: {
                                $sum: "$TPS"

                            }
                        }
                    }
                ]).toArray(
                (err, result) =&gt; {
                if (err) {
                    return console.log(err)
                } else {
                    if (Object.keys(result).length === 0) {}
                    else {
                        console.log(result[0]);
                        AggArr.push(result[0]);
                    }
                }
            })
        }
        }
    })
</code></pre>

<p>I'm new to Node.js programming and stuck at this trivial problem, any help is appreciated.</p>

