Remove an element in an Object Array in Mongodb?<p>I have a document below:</p>

<pre><code>{
  _id: ObjectId,
  name: 'String',
  description: 'String',
  articles: [
    { reference: ObjectId, title: 'String', digest: 'String', content: '...' },
    { reference: ObjectId, title: 'String', digest: 'String', content: '...' },
    { reference: ObjectId, title: 'String', digest: 'String', content: '...' },
    { reference: ObjectId, title: 'String', digest: 'String', content: '...' },
    ...
  ]
}
</code></pre>

<p>I want to only remove one specific article with ObjectId <code>aid</code> from this document. So I use the method with <code>mongoose</code>:</p>

<pre><code>Model.update({
  _id: 'the document ObjectId',
}, {
  $pull: {
    articles: {
      $elemMatch: {
        reference: aid,
      },
    },
  },
});
</code></pre>

<p>the result is: </p>

<pre><code>{n: 1, nModified: 1, ok: 1}
</code></pre>

<p>But the document change is different from what I expect:</p>

<pre><code>{
  _id: ObjectId,
  name: 'String',
  description: 'String',
  articles: [],
}
</code></pre>

<p>I want to know why and how to remove one specific article as I expect.</p>

