How to Strictly specify a return type Angular4/ionic3<p>Please I'm trying to specify a particular return type to only include the data that i need from a mongodb server using nodejs.</p>

<p>These are the issues that i'm facing:
 1. the nodejs server always returns an array of json data, which makes it compulsory for me to access the data in ionic3 as indexes(data[0]) instead of dot notation(data.). How can i fix this please ?
 2. the data that's being returned from the database dumps a lot of data back to the client side, I want to filter this data using a typescript interface which i'm importing into the service. I'm going to show an extract of my code in place</p>

<p>ProfileModel interface</p>

<pre><code>**(profileModel.ts)**

export interface ProfileModel{
  name : {
            firstName : string,
            lastName : string
    },
    login : {
            username: string
    },

        sex : string,
        address: string,
        status: string,
        coverageArea: string,
        email : string,
        position: string,
        location : {
            latitude: number,
            longitude: number
        }
}
</code></pre>

<p>The Profile Service Provider function</p>

<pre><code>**(profile.ts)**

import { ProfileModel } from './profileModel';
  getMyProfile(data){
    return this.http.get&lt;ProfileModel&gt;(this.apiUrl + data)
    .pipe(catchError(this.handleError))     
  }



  private handleError(error: HttpErrorResponse){
      if(error.error instanceof ErrorEvent){
          // A client-side or network error occured
          console.error("An error occured: ", error.error.message)
      } else {
          // The backend returned unsuccessful response
          // The response body may contain clues as to what happened
          console.error(`Backend returned code ${error.status}, `+
            `body was: ${error.error}`);
      }
      return new ErrorObservable("Network Error, please try again later.")
  }
</code></pre>

<p>Profile Route Server Side Code</p>

<pre><code>//Set up
let express = require("express");
let router = express.Router();

let staffModel = require("../schema");


router.get("/profile/:user", function(req, res){ 
    //let check = req.params();
    staffModel.find({"login.username": req.param("user")})
        .then(data=&gt; {
            res.setHeader("Content-Type", "application/json");
            let check = JSON.stringify(data);
            res.send(check);
        })
        .catch(err=&gt; res.send({"error": "There's an issue with the server."}))
});

module.exports = router;
</code></pre>

<p>Even with these in place, I still get a data dump, that i access with an index and also, it dumps all the unnecessary datas that i don't need from the db</p>

<p>Please any help would be greatly appreciated</p>

