{ "_id" : "yyy", "num" : 8 }
{ "_id" : "zzz", "num" : 9 }
</code></pre>

<p>So far I've tried this:</p>

<pre><code>db.collection.aggregate([
  { $project: { title:1, category:1} },
  { $group: {
      _id: { _id:"$category"},
