Can I make Mongo map reduce count multiple values of an object?<p>I have a collection that I am trying to map reduce by id and date to produce a graph for sales of a product in store vs online. A new object is created for each transaction, so I would like to reduce them to a total count for a given day. An object looks something like this:</p>

<pre><code>object
{
      "ProductID": 1
      "Purchase Method": In Store
      "Date": 2018-01-16
      "Count": 5
}
</code></pre>

<p>What I am trying to achieve as output is to have in store and online purchases combined into 1 object with a key being the id and the date and then the value being the counts of each method as shown below:</p>

<pre><code>ProductID: 1
Date: 2018-01-16
[
    {Name: "In store", Count: 3}
    {Name: "Online", Count: 2}
]
</code></pre>

<p>My current method was to map the objects by Id, date, and Purchase Method so the reduce would get the total count for that id on that date using that method, but this leads to having two entries for an id and date, 1 for in store and 1 for online. This is the current state of my functions: </p>

<pre><code>var mapDailySales = function() {
var sale = this;

/*Converts timestamp to just date */
var pad = function pad(n, width, z) {
z = z || '0';
n = n + '';
return n.length &gt;= width ? n : new Array(width - n.length + 1).join(z) + n;
};

var d = sale.Date;
var date = d.getFullYear() + "-" + pad(d.getMonth() + 1, 2, 0) + "-" + pad(d.getDate(), 2, 0);

emit({ProductId: sale.ProductID, Date:date, Method: sale.PurchaseMethod},
{Name: sale.PurchaseMethod, Count: 1})
};


var reduceDailySales = function(key, value) {
var res = {Name: 0, Count: 0};

value.forEach(function(value){
res.Name = value.Name;
res.Count += value.Count;
});

return res; 
};
</code></pre>

<p>Current Output looks something like this:</p>

<pre><code>{
    "_id" : {
        "ProductId" : 1,
        "Date" : "2018-01-16",
        "Method" : "Online"
    },
    "value" : {
        "Name" : "Online",
        "Count" : 3
    }
}
</code></pre>

<p>Is there a way to achieve my desired output without map reducing again on the current output?</p>

